&lt;h3&gt;Bids Due&lt;/h3&gt;
Bids are due by the Thursday of Keep on the Borderlands each year. For SKBC 2019, bids are due Thursday, September 20th, 2018. We highly encourage you to submit bids prior to this date via &lt;a href=&#039;https://fwack.org&#039;&gt;FWACK&lt;/a&gt;. 
&lt;h3&gt;Early Registration/Pre-Pay Closed&lt;/h3&gt;
Prepay is usually available in early October through the event date.
